              ? {
                  Authorization:
                    "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6Miwicm9sZSI6Im5vcm1hbCIsImlhdCI6MTY3NTI2NDAxNSwiZXhwIjoxNjc1ODY4ODE1fQ.lvcPuNQ_LVOGTy2DtMukQKMik3wBk0ztB77TwLZoRLk",
                }
              : {},
        });

        if (!res.ok) {
          throw new Error("error fetching API");
        }
        console.log("res", res);
        const body = await res.json();

        console.log(body);
      } catch (error) {
        setErrorMessage(error.message);
      }
    };
    fetchEntries();
  }, []);

  return (
    <section>
      <h2>Entries</h2>
      {errorMessage && <p> error:{errorMessage}</p>}
    </section>
  );
};
export default PostPage;
